import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import QRGenerator from './QRGenerator';
import './PetForm.css';

const PetForm = () => {
  const [petData, setPetData] = useState({
    name: '',
    species: 'dog',
    breed: '',
    age: '',
    gender: '',
    color: '',
    photo: null,
    qrCode: null
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setPetData({
      ...petData,
      [name]: files ? files[0] : value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Generate QR code here (will implement in QRGenerator.js)
    console.log('Pet registered:', petData);
  };

  return (
    <div className="pet-registration-container">
      <div className="pet-form">
        <h2>Register Your Pet</h2>
        <form onSubmit={handleSubmit}>
          {/* Pet Photo Upload */}
          <div className="form-group">
            <label>Pet Photo*</label>
            <input 
              type="file" 
              accept="image/*" 
              onChange={handleChange}
              name="photo"
              required
            />
          </div>

          {/* Basic Info */}
          <div className="form-group">
            <label>Pet Name*</label>
            <input
              type="text"
              name="name"
              value={petData.name}
              onChange={handleChange}
              required
            />
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Species*</label>
              <select name="species" value={petData.species} onChange={handleChange}>
                <option value="dog">Dog</option>
                <option value="cat">Cat</option>
                <option value="bird">Bird</option>
                <option value="other">Other</option>
              </select>
            </div>

            <div className="form-group">
              <label>Breed*</label>
              <input
                type="text"
                name="breed"
                value={petData.breed}
                onChange={handleChange}
                required
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Age (years)*</label>
              <input
                type="number"
                name="age"
                min="0"
                max="30"
                value={petData.age}
                onChange={handleChange}
                required
              />
            </div>

            <div className="form-group">
              <label>Gender*</label>
              <div className="radio-group">
                <label>
                  <input
                    type="radio"
                    name="gender"
                    value="male"
                    checked={petData.gender === 'male'}
                    onChange={handleChange}
                    required
                  /> Male
                </label>
                <label>
                  <input
                    type="radio"
                    name="gender"
                    value="female"
                    checked={petData.gender === 'female'}
                    onChange={handleChange}
                  /> Female
                </label>
              </div>
            </div>
          </div>

          <div className="form-group">
            <label>Color/Markings*</label>
            <input
              type="text"
              name="color"
              value={petData.color}
              onChange={handleChange}
              required
            />
          </div>

          {/* QR Code Preview (will appear after submission) */}
          {petData.qrCode && (
            <div className="qr-preview">
              <h3>Your Pet's QR Code</h3>
              <QRGenerator petId={petData.name + petData.species} />
              <p>Print this and attach to your pet's collar</p>
            </div>
          )}

          <button type="submit" className="submit-btn">
            Register Pet
          </button>
        </form>
      </div>
    </div>
  );
};

export default PetForm;
